import React, { useState, useEffect } from "react";

const Home = () => {
    const [facultyData, setFacultyData] = useState([]);

    useEffect(() => {
        fetch("/database/data.json")
            .then((res) => res.json())
            .then((data) => setFacultyData(data.faculty || []))
            .catch((err) => console.error("Error loading faculty data:", err));
    }, []);

    return (
        <div>
            <h1 className="mb-4">Faculty Details</h1>
            <div className="row">
                {facultyData.map((faculty, index) => (
                    <div className="col-md-4" key={index}>
                        <div className="card mb-4">
                            <div className="card-body">
                                <h5 className="card-title">{faculty.name}</h5>
                                <p className="card-text">Department: {faculty.department}</p>
                                <p className="card-text">Email: {faculty.email}</p>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Home;
